#
# TABLE STRUCTURE FOR: monitorweb_agent
#

DROP TABLE IF EXISTS `monitorweb_agent`;

CREATE TABLE `monitorweb_agent` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(200) NOT NULL,
  `ip` char(39) NOT NULL,
  `health` varchar(200) NOT NULL,
  `registered_at` datetime(6) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



#
# TABLE STRUCTURE FOR: monitorweb_alert
#

DROP TABLE IF EXISTS `monitorweb_alert`;

CREATE TABLE `monitorweb_alert` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `message` varchar(500) NOT NULL,
  `src` char(39) NOT NULL,
  `srcp` int(10) unsigned DEFAULT NULL CHECK (`srcp` >= 0),
  `dst` char(39) NOT NULL,
  `dstp` int(10) unsigned NOT NULL CHECK (`dstp` >= 0),
  `protocol` varchar(10) NOT NULL,
  `action` varchar(50) NOT NULL,
  `agent_id` bigint(20) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `monitorweb_alert_agent_id_69bf1a30_fk_monitorweb_agent_id` (`agent_id`),
  CONSTRAINT `monitorweb_alert_agent_id_69bf1a30_fk_monitorweb_agent_id` FOREIGN KEY (`agent_id`) REFERENCES `monitorweb_agent` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=1001 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;



